import React from 'react';
import Button from './Button';

const Quadrant = ({ title, options }) => (
  <div className="quadrant">
    <h2>{title}</h2>
    <div>
      {options.map(option => <Button key={option}>{option}</Button>)}
    </div>
  </div>
);

export default Quadrant;
